import { useState } from "react"
import { Navbar } from "flowbite-react";
import { Link } from 'react-router-dom'
import {useLinkClickHandler, useLocation} from "react-router-dom";

export default function TopMenu(){
  const location = useLocation();
  const goWords= useLinkClickHandler("/words");
  const goMain = useLinkClickHandler("/");
    const [activeItem, setActiveItem] = useState<string>('Words')
    return (
      <div className="mb-4">
        <Navbar fluid={true} rounded={true}>
            <Navbar.Brand href="/">
                <span onClick={goMain} className="self-center whitespace-nowrap text-xl font-semibold dark:text-white">
                    StudyWord
                </span>
            </Navbar.Brand>
            <Navbar.Toggle />
            <Navbar.Collapse>
              <span onClick={goWords}>
                  <Navbar.Link href="/navbars" active={location.pathname === '/words'} color='dark'>
                  Группы слов
                  </Navbar.Link>
                </span>
            </Navbar.Collapse>
        </Navbar>
      </div>
    )
}
